      body: "## What's Changed\r\n* Golang alpine update by @mliljedahl in https://github.com/runatlantis/atlantis/pull/2562\r\n*
        Revert \"Fix concurrency in `atlantis-image` workflow\" by @jamengual in https://github.com/runatlantis/atlantis/pull/2565\r\n*
        (README) Use join.slack.com instead of custom heroku app by @douglascayers
        in https://github.com/runatlantis/atlantis/pull/2564\r\n* Updating to new
        base image by @jamengual in https://github.com/runatlantis/atlantis/pull/2563\r\n*
        Fix server-configuration docs, missing newline by @erpel in https://github.com/runatlantis/atlantis/pull/2567\r\n*
        build(deps): bump github.com/microcosm-cc/bluemonday from 1.0.20 to 1.0.21
        by @dependabot in https://github.com/runatlantis/atlantis/pull/2548\r\n* deps:
        bump terrform to 1.3.2 by @chenrui333 in https://github.com/runatlantis/atlantis/pull/2569\r\n*
        docs: fill all command line flags not in the document, and more. by @chroju
        in https://github.com/runatlantis/atlantis/pull/2568\r\n* docs: added GitHub
        app permission in #2380 by @chroju in https://github.com/runatlantis/atlantis/pull/2572\r\n*
        Release 0.20.1 by @jamengual in https://github.com/runatlantis/atlantis/pull/2571\r\n\r\n##
        New Contributors\r\n* @douglascayers made their first contribution in https://github.com/runatlantis/atlantis/pull/2564\r\n*
        @erpel made their first contribution in https://github.com/runatlantis/atlantis/pull/2567\r\n\r\n**Full
        Changelog**: https://github.com/runatlantis/atlantis/compare/v0.20.0...v0.20.1"
