          body: "## What's Changed\r\n* build(deps): bump go.uber.org/zap from 1.21.0
            to 1.22.0 by @dependabot in https://github.com/runatlantis/atlantis/pull/2448\r\n*
            Make required atlantis/apply status check work with mergeable by @rayterrill
            in https://github.com/runatlantis/atlantis/pull/2436\r\n* build(deps):
            bump golang from 1.17-alpine to 1.19.0-alpine by @dependabot in https://github.com/runatlantis/atlantis/pull/2433\r\n*
            Allow manual PR number by @cep21 in https://github.com/runatlantis/atlantis/pull/2465\r\n*
            ignore GitLab Draft MRs by @becjon in https://github.com/runatlantis/atlantis/pull/2468\r\n*
            enable hostname (not only IP Address) on Metrics statsd host key by @kangaechu
            in https://github.com/runatlantis/atlantis/pull/2429\r\n* Omit type declaration
            of vars by @estensen in https://github.com/runatlantis/atlantis/pull/2476\r\n*
            build(deps): bump go.uber.org/zap from 1.22.0 to 1.23.0 by @dependabot
            in https://github.com/runatlantis/atlantis/pull/2478\r\n* build(deps):
            bump github.com/microcosm-cc/bluemonday from 1.0.19 to 1.0.20 by @dependabot
            in https://github.com/runatlantis/atlantis/pull/2487\r\n* build(deps):
            bump github.com/urfave/cli from 1.22.9 to 1.22.10 by @dependabot in https://github.com/runatlantis/atlantis/pull/2488\r\n*
            deps: bump tf to 1.2.9 by @chenrui333 in https://github.com/runatlantis/atlantis/pull/2499\r\n*
            Use proper http client for github v4 api by @ysoldak in https://github.com/runatlantis/atlantis/pull/2479\r\n*
            deps: bump conftest to 0.34.0 by @chenrui333 in https://github.com/runatlantis/atlantis/pull/2500\r\n*
            External Locking DB: Redis by @SudoSpartanDan in https://github.com/runatlantis/atlantis/pull/2491\r\n*
            workflows: update runner to use ubuntu-22.04 by @chenrui333 in https://github.com/runatlantis/atlantis/pull/2502\r\n*
            fix: allow requests to /api/* without authentication by @vincentgna in
            https://github.com/runatlantis/atlantis/pull/2455\r\n* bug: Fix GitHub
            Markdown for added and deleted resources by @pauloconnor in https://github.com/runatlantis/atlantis/pull/2418\r\n*
            Use single github v4 client by @ysoldak in https://github.com/runatlantis/atlantis/pull/2480\r\n*
            feat: support parallel execution with order groups by @tufitko in https://github.com/runatlantis/atlantis/pull/2403\r\n*
            lint: remove deprecated io/util package by @chenrui333 in https://github.com/runatlantis/atlantis/pull/2503\r\n*
            Fixes for multienv step comment by @hatmarch in https://github.com/runatlantis/atlantis/pull/2411\r\n*
            fix: Set mergeable correctly when branch protection doesn't require reviewers
            by @stasostrovskyi in https://github.com/runatlantis/atlantis/pull/2470\r\n*
            Adding Redis TLS Option by @SudoSpartanDan in https://github.com/runatlantis/atlantis/pull/2510\r\n*
            build(deps): bump github.com/spf13/viper from 1.12.0 to 1.13.0 by @dependabot
            in https://github.com/runatlantis/atlantis/pull/2517\r\n* build(deps):
            bump runatlantis/atlantis-base from 2022.08.05 to 2022.09.08 by @dependabot
            in https://github.com/runatlantis/atlantis/pull/2515\r\n* build(deps):
            bump github.com/moby/moby from 20.10.17+incompatible to 20.10.18+incompatible
            by @dependabot in https://github.com/runatlantis/atlantis/pull/2516\r\n*
            lint:  recursive gofmt by @chenrui333 in https://github.com/runatlantis/atlantis/pull/2504\r\n*
            build(deps): bump golang from 1.19.0-alpine to 1.19.1-alpine by @dependabot
            in https://github.com/runatlantis/atlantis/pull/2514\r\n* chore: Use hadolint
            to fix DL4006, SC2086 by @nitrocode in https://github.com/runatlantis/atlantis/pull/2530\r\n*
            Adding Redis DB option by @Omicron7 in https://github.com/runatlantis/atlantis/pull/2527\r\n*
            Fix: Error when enabling prometheus metrics by @albertollamaso in https://github.com/runatlantis/atlantis/pull/2528\r\n*
            deps: bump tf to 1.3.0 by @andy-paine-numan in https://github.com/runatlantis/atlantis/pull/2533\r\n*
            Delete previous plans on autoplan or atlantis plan by @giuli007 in https://github.com/runatlantis/atlantis/pull/1633\r\n*
            docs: execution_order_group belongs to Project by @taiki45 in https://github.com/runatlantis/atlantis/pull/2539\r\n*
            build(deps): bump actions/stale from 5 to 6 by @dependabot in https://github.com/runatlantis/atlantis/pull/2540\r\n*
            deps: upgrade terraform to v1.3.1 by @chenrui333 in https://github.com/runatlantis/atlantis/pull/2543\r\n*
            Getting working workspace from Terraform Cloud configuration by @cucxabong
            in https://github.com/runatlantis/atlantis/pull/2432\r\n* Release v0.19.9
            by @jamengual in https://github.com/runatlantis/atlantis/pull/2552\r\n\r\n##
            New Contributors\r\n* @rayterrill made their first contribution in https://github.com/runatlantis/atlantis/pull/2436\r\n*
